column5:
[api] common.validateArgs method improvements.

- added optional parameter "returnErrors" to common.validateArgs() method.
- if returnErrors parameter passed as true, validateArgs method returns object with this format.
{
   result:true,
   errors: [],
   obj: {field1:value1, field2:value2}
}

or

{
   result:false,
   errors: ['Invalid type for arg2'],
   obj: {}
}

[populator] More consistent behaviour in accordance to flows

- consecutive execution of requests;
- less variativity of events to limit number of flows generated;
- wating for actual data population to complete before showing "OK" status;
- wating for jobs to complete when flows plugin is enabled;
